import React,{Component} from "react";
import "./NotSignedIn.css";
import { Link } from "react-router-dom";

class NotSignedIn extends Component{
    constructor(props){
        super(props);

    }
    render(){
        return(
            <div className="NotSignedIn_nav">
                <h2>ALT-F4</h2>
                <div className="NotSignedIn_right">
                    <Link exact to="/signup" className="NotSignedIn_EditorLink"

                        params={{googleLogin:this.props.googleLogin}}
                    >
                        Sign Up
                    </Link>
                    <Link exact to="/login" className="NotSignedIn_EditorLink">
                        Login
                    </Link>
                </div>
        </div>
        )
    }
}

export default NotSignedIn;
